// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;
import AwHeaderTitle from 'viewmodel/AwHeaderTitleViewModel';
import AwWorkareaTitle from 'viewmodel/AwWorkareaTitleViewModel';
import { ExistWhen } from 'js/hocCollection';
const DivExistWhen = ExistWhen('div');
const AwWorkareaTitleExistWhen = ExistWhen(AwWorkareaTitle);



/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/awHeaderService', () => import('js/awHeaderService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "updateBreadcrumbAction": {
            "actionType": "JSFunction",
            "method": "updateBreadCrumb",
            "deps": "js/awHeaderService",
            "inputData": {
                "eventData": "{{data.eventMap['refreshBreadCrumb']}}"
            },
            "outputData": {
                "breadCrumbProvider": "result.breadCrumbProvider",
                "breadcrumbConfig": "result.breadcrumbConfig",
                "objFound": "result.objFound"
            }
        },
        "resetBreadcrumbAction": {
            "actionType": "JSFunction",
            "method": "resetBreadCrumb",
            "deps": "js/awHeaderService",
            "outputData": {
                "breadCrumbProvider": "result.breadCrumbProvider"
            }
        },
        "getBreadcrumbConfig": {
            "actionType": "JSFunction",
            "method": "getBreadcrumbConfig",
            "deps": "js/awHeaderService",
            "inputData": {},
            "outputData": {
                "breadcrumbConfig": ""
            }
        }
    },
    "onEvent": [
        {
            "eventId": "refreshBreadCrumb",
            "cacheEventData": true,
            "action": "updateBreadcrumbAction"
        },
        {
            "eventId": "resetBreadCrumb",
            "action": "resetBreadcrumbAction"
        }
    ],
    "ctx": {
        "location.titles.headerTitle": null
    },
    "lifecycleHooks": {
        "onMount": "getBreadcrumbConfig",
        "onUnmount": "resetBreadcrumbAction"
    },
    "_viewModelId": "CommonHeaderTitle",
    "_uniqueViewModelId": "CommonHeaderTitle"
};

/*
<div class='awHeader sw-column'>
    <div class ='sw-row aw-layout-headerTitleContainer'>
        <aw-header-title headertitle="ctx.location.titles.headerTitle" headervmo="props.subPanelContext.headerViewModel" headerproperties="subPanelContext.headerProperties"></aw-header-title>
    </div>
    <div class='sw-row '>
        <div exist-when="ctx.sublocationTitleErrorMessage" class='aw-layout-validationErrorMessage'>{ctx.sublocationTitleErrorMessage}</div>
        <aw-workarea-title exist-when="!ctx.sublocationTitleErrorMessage" provider="data.breadCrumbProvider" breadcrumb-config="data.breadcrumbConfig"></aw-workarea-title>
    </div>
</div>
*/
const renderFn =(props)=> {
    let subPanelContext = props.subPanelContext ;
    let { viewModel: { data, dataProviders, dispatch, conditions, selectionModels, editHandlers, chartProviders, ports  }, grids, ctx, actions, fields, messages, i18n, formProp, viewPath  } = props;
    data = {...data, dataProviders};
    if( subPanelContext && subPanelContext.fields ){
        fields = { ...fields, ...subPanelContext.fields };
    }
    let $index = null;
    return (
            <div className="awHeader sw-column">
        <div className="sw-row aw-layout-headerTitleContainer">
            <AwHeaderTitle headertitle={AwParseService.instance( "ctx.location.titles.headerTitle" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} headervmo={AwParseService.instance( "props.subPanelContext.headerViewModel" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} headerproperties={AwParseService.instance( "subPanelContext.headerProperties" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
            </AwHeaderTitle>
        </div>
        <div className="sw-row ">
            <DivExistWhen className="aw-layout-validationErrorMessage" existWhen={AwParseService.instance( "ctx.sublocationTitleErrorMessage" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                {ctx.sublocationTitleErrorMessage}
            </DivExistWhen>
            <AwWorkareaTitleExistWhen provider={AwParseService.instance( "data.breadCrumbProvider" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} breadcrumbConfig={AwParseService.instance( "data.breadcrumbConfig" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} existWhen={AwParseService.instance( "!ctx.sublocationTitleErrorMessage" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
            </AwWorkareaTitleExistWhen>
        </div>
    </div>
    )
};


/*
define component
*/
const Component = createComponent( declViewModelJson, renderFn, undefined, ctxImportObj );

export default Component;
